import logo from './logo.svg';
import './App.css';
import Pend_ID from './components/lista_pendientes_ID';
import Pend_ID_Title from './components/lista_pendientes_ID_Titles';
import Pend_sin_resolver_ID_Title from './components/lista_pend_sin_resolver_ID_Title';
import Pend_resueltos_ID_Title from './components/lista_pend_resuelto_ID_Title';
import Pend_ID_UserID from './components/lista_pend_ID_UserID';
import Pend_resueltos_ID_UserID from './components/lista_pend_resuelto_ID_UserID';
import Pend_sin_resolver_ID_UserID from './components/lista_pend_sin_resolver_ID_UserID';

const Pendiente_ID = () => {

  return (

    <div>

      <h1>Lista de pendientes</h1>

      <Pend_ID />

    </div>

  );

};

const Pendiente_ID_Title = () => {

  return (

    <div>

      <h1>Lista de pendientes (IDs y Titles)</h1>

      <Pend_ID_Title />

    </div>

  );

};

const Peniende_sinresolver_ID_Titles= () => {

  return (

    <div>

      <h1>Lista de pendientes sin resolver (IDs y Title)</h1>

      <Pend_sin_resolver_ID_Title />

    </div>

  );

};

const Pendiente_resuelto = () => {

  return (

    <div>

      <h1>Lista de pendientes resueltos (IDs y Titles)</h1>

      <Pend_resueltos_ID_Title/>

    </div>

  );

};

const Pendiente_ID_UserID = () => {

  return (

    <div>

      <h1>Lista de pendientes (IDs y UserID)</h1>

      <Pend_ID_UserID/>

    </div>

  );

};

const Pendiente_resueltos_ID_UserID = () => {

  return (

    <div>

      <h1>Lista de pendientes resueltos (IDs y UserID)</h1>

      <Pend_resueltos_ID_UserID/>

    </div>

  );

};

const Pendiente_sin_resolver_ID_UserID= () => {

  return (

    <div>

      <h1>Lista de pendientes Sin Resolver (IDs y UserID)</h1>

      <Pend_sin_resolver_ID_UserID/>

    </div>

  );

};
